import React from 'react';
import '../stylesheets/Taskbar.css';
import logo from '../img/logo.png';

function Taskbar() {
  return (
    <div className="taskbar">
      <a href="/">
        <img src={logo} alt="SadLogo" className="logo-image taskbar-item" />
      </a>
      <a href="/" className="taskbar-button active taskbar-item">Home</a>
      <a href="/about" className="taskbar-button taskbar-item">About Me</a>
      <a href="/resume" className="taskbar-button taskbar-item">Resume</a>
      <a href="/academics" className="taskbar-button taskbar-item">Academics</a>
      <a href="/articles" className="taskbar-button taskbar-item">Articles</a>
      <a href="/wiki" className="taskbar-button taskbar-item">Wiki</a>
    </div>
  );
}

export default Taskbar;
